(function ($) {

    'use strict';

    Drupal.behaviors.filter_by_category = {
        attach: function (context, settings) {
            let selectStateAndLearn = $('.views-exposed-form .form-item-term-node-tid-depth select');
            let spmByCaterory = $('#views-exposed-form-spm-page-block-by-category-block .form-item-service-group select');
            if (selectStateAndLearn.length || spmByCaterory.length) {
                selectStateAndLearn.once().change(function () {
                    $('.view-related-post button.form-submit').click();
                });
                spmByCaterory.once().change(function () {
                    $('#views-exposed-form-spm-page-block-by-category-block button.form-submit').click();
                });
            }

        }
    }

    Drupal.behaviors.filter = {
        attach: function (context, settings) {
            var i;
            var leng = $('.widget-wrapper div.star-first span.on').length;
            for (i = 0; i < leng; ++i) {
                var value = $('.widget-wrapper div.star-first span.on')[i];
                var integer = parseInt($(value).html().substr(0, 1)) + 1;
                var float = $(value).html().substr(2, 1) + 0;
                var widget = $("div.star-wrapper div.star:nth-child(" +integer +') span.on')[i];
                $(widget).css('width', float +'%');
            }

            $(window, context).scroll(function() {
                if ($(window).width() >= 768) {
                    if ($(window).scrollTop() < 30) {
                        $('.intro-bar').css('top', 30 - $(window).scrollTop());
                    }
                    else {
                        $('.intro-bar').css('top', '0px');
                    }
                }

                //added class to intro-bar when scrolled to content block or Related Articles block
                if ($('.company-list-page').length) {
                    if ($(window).scrollTop() > $('.sub-content').next().offset().top && ($('.block-companies-list-related-articles').length == 0 || $(window).scrollTop() < $('.block-companies-list-related-articles').offset().top - 85)) {
                        $('header').stick_in_parent({bottoming: false});
                        $('.header-line').stick_in_parent({bottoming: false});
                    }

                    if ($(window).width() >= 768) {
                        $('.intro-bar').toggleClass('scrolled', ($(window).scrollTop() > 30));
                        if($('.block-companies-list-related-articles').length) {
                          var link=$(".block-companies-list-related-articles");
                          var top = link.offset().top; // position from $(document).offset().top
                          var bottom = top + link.outerHeight(); // position from $(document).offset().top
                          var bottomFromBottom = $(document).height() - bottom;
                          $('.intro-bar').toggleClass('floating', ($(window).scrollTop() > $(document).height() - $(window).height() - (bottomFromBottom + link.outerHeight())));
                        }
                    }
                }
            });
            $('.alert-danger').addClass('col-md-12').hide(); //need to be removed in future

            //prevent zooming on mobile devices
            var attr = $("meta[name='viewport']").attr('content');
            $("meta[name='viewport']").attr('content', attr + ', minimum-scale=1.0, maximum-scale=1.0, user-scalable=no');

            //added classes to collapse button on into-bar
            /**
              * Uncomment it and make changes in css
              * to make intro bar and header collapsible
            * $('.bar-button').click(function() {
              * $('.intro-bar').toggleClass('bar-collapse');
              * $('header').toggleClass('header-collapse');
              * $('header').addClass('header-collapsible');
              * $('.view-display-id-page_1').toggleClass('content-collapse');
              * $('.view-display-id-page_1').addClass('content-collapsible');
            * });
            */
        }
    }

    Drupal.behaviors.fontSizes = {
        attach: function (context, settings) {
            var teaserTitle = $('.views-element-container .col-md-3 .teaser-title span');
            //remove image if it broken
            $(".field--name-field-a-background-image img").on('error', function(){
                $(this).closest('.article').addClass('no-image');
                $(this).hide();
            });

            if ($(window).width() <= 480) {
                var i;
                var count = $('h3.text-uppercase span').length;
                for (i = 0; i < count; i++) {
                    var element = $('h3.text-uppercase span')[i];
                    var wordsArray = $(element).text().split(' ');
                    $.each(wordsArray, function(k, word) {
                        if (word.length >= 9 && word.length < 11) {
                            $(element).addClass('long9');
                        }
                        else if (word.length >= 11) {
                            $(element).addClass('long11');
                        }
                    });
                }
            }
            //trim teaser title and add '...'
            if ($(window).width() >= 992 && teaserTitle.length) {
                teaserTitle.once().each(function() {
                    var titleVal = $(this).text();
                    var titleLeng = titleVal.length;
                    if (titleLeng > 80) {
                        $(this).text(titleVal.substring(0, 80) + '...');
                    }
                });
            }
        }
    }

    Drupal.behaviors.general = {
        attach: function (context, settings) {
            var wideBlock = $('.block-views-blockhomepage-articles-blocks-homepage-wide-block1');
            var listArticle = $('.block-views-blockhomepage-articles-blocks-block-3');
            const $h1 = $('.title-underline h1');
            if ($h1 !== undefined && $h1.length > 0) {
              $('.article-broch-wrap').find('h1').replaceWith(function () {
                return '<h2 class="teaser-brochure-title">' + $(this).html() + '</h2>';
              });
            }
            //Mobile menu behavior
            $('.navbar-collapse').on('show.bs.collapse', function() {
                $('header .navbar-toggle').toggleClass('mobilemenu');
            });
            $('.navbar-collapse').on('hide.bs.collapse', function() {
                $('header .navbar-toggle').removeClass('mobilemenu');
            });

            var sponsorFlags = $('article.company-list .sponsor-flag');
            if ($(sponsorFlags).length && !$('ul .row-index').length) {
                sponsorFlags.addClass('alphabetic-flag');
            }
        }
    }

    Drupal.behaviors.pager = {
        attach: function (context, settings) {
            //remove 'page' parameter from url
            var uri = window.location.toString();
            var page0 = uri.substring(uri.indexOf("?") + 1);
            if (uri.indexOf("?") > 0 && page0 === 'page=0') {
                var clean_uri = uri.substring(0, uri.indexOf("?"));
                window.history.replaceState({}, document.title, clean_uri);
            }
        }
    }

    Drupal.behaviors.tableSort = {
        attach: function (context, settings) {
            if ($('#history-table').length) {
                var table = document.querySelector('#history-table');
                var element = $("[mainid]");
                table.addEventListener('Sortable.sorted', function() {
                    element.each(function(){
                        var id = $(this).attr('mainid');
                        $("tr[mainid=" + id + "]").after($("#" + id));
                    });
                });

                $('th').once().click(function(){
                    if ($(this).hasClass('asc')) {
                        $('th').removeClass('asc');
                        $(this).addClass('desc');
                    }
                    else if($(this).hasClass('desc')) {
                        $('th').removeClass('desc');
                        $(this).addClass('asc');
                    }
                    else {
                        $('th').removeClass('asc');
                        $('th').removeClass('desc');
                        $(this).addClass('asc');
                    }
                });
            }
        }
    }

    Drupal.behaviors.MatchMakingLP = {
      attach: function(context) {
        if($('#match-lp', context).length) {
          // showing proper button based on choosen select value
          const matchSelects = document.querySelectorAll('.match-select-wrap select');
          const matchOptions = document.querySelectorAll('.match-option');

          matchSelects.forEach(function(item) {
            item.addEventListener('change', function(event) {
              const optionValue = event.srcElement.options[event.srcElement.selectedIndex].value;
              matchOptions.forEach(function(option) {
                option.classList.remove('active');
                if (option.getAttribute('data-variant') === optionValue) option.classList.add('active');
              });
              matchSelects.forEach(function(select) {
                select.selectedIndex = event.srcElement.selectedIndex;
                select.dispatchEvent(new Event('manual-change', { 'bubbles': true }))
              });
            });
          });

          // Custom Select:
          const matchCustomSelects = document.querySelectorAll('select.match-custom-select');
          matchCustomSelects.forEach(function(select) {
            // wrapper
            const customSelectWrap = document.createElement('div');
            customSelectWrap.classList.add('match-custom-select');
            customSelectWrap.innerHTML = '<div class="match-custom-select-value"></div><div class="match-custom-select-options"></div>'
            // listen to manual-change event on select
            select.addEventListener('manual-change', function(event) {
              setValue(options[event.srcElement.selectedIndex].text);
            })
            // options
            const customOptionsWrap = customSelectWrap.querySelector('.match-custom-select-options');
            let options = Array.from(select.options);
            options.forEach(function(option, index) {
              const customOption = document.createElement('div');
              customOption.setAttribute('data-value', option.value);
              customOption.classList.add('match-custom-select-option');
              if (index === select.selectedIndex) customOption.classList.add('selected');
              customOption.innerHTML = option.text;
              customOption.addEventListener('click', function() {
                toggleOpen();
                setValue(option.text);
                select.selectedIndex = index;
                select.dispatchEvent(new Event('change', { 'bubbles': true }))
              });
              customOptionsWrap.appendChild(customOption);
            });
            // method for setting the value
            const valueWrap = customSelectWrap.querySelector('.match-custom-select-value');
            const setValue = function(val) {
              valueWrap.innerHTML = val;
            }
            //setting a start value
            setValue(select.getAttribute('data-placeholder'));
            // method for opening/closing
            const toggleOpen = function() {
              customSelectWrap.classList.toggle('open');
            }
            valueWrap.addEventListener('click', function() {
              toggleOpen();
            });
            select.parentNode.insertBefore(customSelectWrap, select);

            // Listen for click outside select
            document.body.addEventListener('click', function (event) {
              const path = Array.from(event.path || (event.composedPath && event.composedPath()));
              if(!path.filter(function(pathEl){ return pathEl === customSelectWrap }).length) {
                if (customSelectWrap.className.includes('open')) toggleOpen();
                event.stopPropagation;
              }
            });
          });
        }
      }
    }

} (jQuery));

